import React from "react";
import NewParty from "../components/NewParty";
import RuleForm from "../components/RuleForm";
import { Navigate, useParams } from "react-router-dom";
import { useQuery } from "@apollo/client";
import { QUERY_PARTY, QUERY_USER } from "../utils/queries";

const Partypage = () => {
  const { partyName: partyParam } = useParams();

  if (Auth.loggedIn() && Auth.getLiveParty().data.partyName === partyParam) {
    return <Navigate to="/liveparty" />;
  }

  if (loading) {
    return (
      <div class="d-flex align-items-center">
        <strong>Loading...</strong>
        <div
          class="spinner-border ms-auto"
          role="status"
          aria-hidden="true"
        ></div>
      </div>
    );
  }
  return (
    <div className="container">
      <div className="page-content">
        {(Context.party = "new" ? <NewParty /> : <Party />)}
        {(Context.party = "new" ? <RuleForm /> : <Party />)}
      </div>
    </div>
  );
};

export default Partypage;
